import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import ConferenceOne from './Conference'

function  SingleConference() {
    return <ConferenceOne />
}

class Conferences extends Component {
    constructor(props) {
        super(props) 

        this.state ={
            conferences: ['SEC', 'ACC', 'PAC-12', 'Big-10', 'Big-12']
        }

    }


    componentDidMount() {

    }

    render() {
        return (
            <div>
                 <h1>Conferences</h1>
                 {this.state.conferences.map(conference => {
                     return <div><Link to={`${this.props.match.url}/${conference}`}>{conference}</Link></div>
                 })}

                 <Route path={`${this.props.match.path}/:teamID`} component={ConferenceOne} />
            </div>
        )
    }
}

export default Conferences
